shaders.vertex:
attribute vec2 aVertex;
attribute vec2 aTexCoord;
varying vec2 vTexCoord;

void main(void)
{
    vTexCoord = aTexCoord;
    gl_Position = vec4(aVertex, 0.0, 1.0);
}

shaders.fragment:
varying vec2 vTexCoord;
uniform sampler2D uTexture;
uniform sampler2D uChannel0;
uniform float uT;
uniform vec2 uMouse;

void main(void)
{
	if (vTexCoord.x < 0.5) {
		gl_FragColor = (vTexCoord.y < 0.5)
			?	texture2D(uTexture, vTexCoord * 2.0)
			: vec4(texture2D(uTexture, vTexCoord * 2.0).r, 0.0, 0.0, 1.0);
	}
	else {
		gl_FragColor = (vTexCoord.y < 0.5)
			? vec4(0.0, texture2D(uTexture, vTexCoord * 2.0).g, 0.0, 1.0)
			: vec4(0.0, 0.0, texture2D(uTexture, vTexCoord * 2.0).b, 1.0);
	}
}
